INSERT INTO `lessons` (`id`, `instructor_id`, `title`, `slug`, `start`, `description`, `price`, `online`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, 102, 'Perspiciatis labore qui voluptates et nisi fugit numquam deleniti tenetur quisquam distinctio eaque eaque sint dolores quasi et repellat dolor non veniam nostrum totam aut.', 'perspiciatis-labore-qui-voluptates-et-nisi-fugit-numquam-deleniti-tenetur-quisquam-distinctio-eaque-eaque-sint-dolores-quasi-et-repellat-dolor-non-veniam-nostrum-totam-aut', '2021-05-19 00:00:00', 'Corporis dignissimos dolorem voluptas et adipisci dignissimos autem sapiente et sint laboriosam reprehenderit voluptatibus quis aut possimus hic dolores odio sit ut velit ratione earum ipsam necessitatibus ut nulla ut enim voluptatem quod vero inventore reiciendis sunt omnis sed omnis tempore qui consequuntur iure et quidem eum rerum corporis ut sed rerum neque.', 50.25, 0, NULL, '2021-08-14 08:31:46', '2021-08-14 08:31:46'),
(2, 103, 'Exercitationem voluptatum animi similique illo architecto error occaecati quia reiciendis magni cumque veniam quos unde et et sequi fugiat.', 'exercitationem-voluptatum-animi-similique-illo-architecto-error-occaecati-quia-reiciendis-magni-cumque-veniam-quos-unde-et-et-sequi-fugiat', '2021-03-14 00:00:00', 'Facere itaque qui consequatur omnis omnis non quibusdam autem blanditiis nisi quia illum iste asperiores accusamus quia reiciendis libero id aut nihil sed ullam possimus consequatur sit ex rerum et tempore similique nesciunt sunt aliquid esse et ut quis eum consequuntur et atque voluptas natus eaque ex eos rerum aspernatur quibusdam repellat quia accusamus omnis aspernatur distinctio et vitae suscipit.', 50.25, 0, NULL, '2021-08-14 08:31:46', '2021-08-14 08:31:46'),
